import logo from './logo.svg';
import './App.css';

let Ola = (props) => {
  return (
    <>
      <p>{props.color}, {props.car}</p>
    </>
  )
}

function App() {
  let  value = 1
  return (
    <Ola color={value} car="ola"></Ola>
  );
}

export default App;
